import { MainFooter, SubFooter,TextFooter } from './Styles/AdminFooterStyles'

const AdminFooter = (props) => {
  return (
    <MainFooter>
      <SubFooter>
        <TextFooter>IT SERVICE DESK CONTACT NUMBER IS 02-6xx-1234</TextFooter>
        <span> </span>
      </SubFooter>
    </MainFooter>
  )
}
export default AdminFooter
